import React from "react";
import { Button } from "react-bootstrap";

function Dashboard() {
  const [display, setdisplay] = useState("none")
    const dataHandling=()=>{
      setdisplay("inline")
    }
  return (
    <div>
      <div className="d-flex justify-content-between m-5">
        <Button variant="outline-primary" size="lg" onClick={dataHandling}>
          Study Material 1
        </Button>
        <Button style={{display:{display}}} variant="outline-primary" size="lg" disabled>
          Time Remaining
        </Button>
      </div>
    </div>
  );
}

export default Dashboard;
